"use strict";app.sliderCompany=function(){var el=$("#js-slider-company"),count=parseInt(el.attr("data-count")),itemStr="";return{init:function(){for(var i=count-1;i>0;i--)itemStr+='<div class="c-slider-company__item"><img class="c-slider-company__img" src="images/'+i+'.jpg" alt=""></div>';el.html(itemStr).slick({autoplay:!0,slidesToShow:5,slidesToScroll:1,centerPadding:0,arrows:!1,touchMove:!1,focusOnSelect:!1,pauseOnFocus:!1,autoplaySpeed:2e3})}}}(),window.addEventListener("load",function(e){(device.desktop()||device.tablet())&&app.sliderCompany.init()});